import styled from "styled-components";

export const PersonDetails = styled.div`
border: 1px solid #0073e6;
border-radius: 15px;
padding: 15px;
margin-bottom: 10px;
background-color: #f0f4ff;
box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
display: flex;
justify-content: space-between;
gap: 12px;
flex-direction: column;
  .phoneStyle {
    display: flex;
    flex-direction: column;
    gap: 0.49em;
  }
  .detailsStyle{
    display: flex;
    margin-top: 10px;
    flex-direction: column;
    gap: 12px;
  }
  .arrowStyle{
    cursor: pointer;
  }
  .summaryStyle{
    display: flex;
    justify-content: sp;
  }
`;
